r($,"aCp","aoa",()=>A.dQ("Climax 1","Nadat je advertenties hebt geplaatst, zijn er veel mensen die agent willen worden van de {naam}. Na veel moeite, kies jij dertig agenten verspreid over het land om de kaas te gaan verkopen. Omdat je na veertig dagen nog niets van ze hebt gehoord, besluit je om er twee te gaan bezoeken in Brussel. De \xe9\xe9n blijkt het verkeerde adres te hebben opgegeven en de ander verklaarde dat die kaasgeschiedenis hem niet interesseerde. Bij het volgende bezoek aan Van Schoonbeke zit jij er gefrustreerd bij, omdat je al zo lang bezig bent en nog steeds niets hebt kunnen bereiken. Van Schoonbeke laat aan het gezelschap weten dat jij tot voorzitter bent gekozen van de Vakbond van Belgische Kaashandelaren, wat jij zelf ook niet wist. Je bent daar helemaal niet blij mee; je wilt niet met dingen gaan bemoeien waar je geen verstand van hebt, je wilt gewoon eindelijk je kaas gaan verkopen. Maar Van Schoonbeke wil jij prestige krijgt, omdat dat ook goed is voor hem. Jullie worden morgen in audi\xebntie ontvangen op het Departement van Handel en ze willen dat jij als plaatsvervangend voorzitter meegaat om geldzaken te regelen. Jouw plan is om ernaartoe te gaan en te zeggen dat jouw gezondheid het niet toelaat. De andere vier worden zenuwachtig en vragen jou of je zou kunnen wachten tot het eind van de audi\xebntie, voordat je ontslag neemt. Wanneer je hen aankijkt, zie je de waarheid beter voor ogen: zij zijn alle vier mensen van aanzien in de kaas, mensen met een verleden, met kaastraditie, mensen van gezag, mensen met geld, maar jij bent maar een nederige klerk die mislukte kaashandelaar is geworden. Misschien wordt het tijd om te stoppen met deze kaasfantasie, maar aan de andere kant worden deze vier mensen boos en daardoor van Schoonbeke ook. Je zult dan waarschijnlijk niet meer welkom zijn bij hem, nadat je hem zo hebt vernederd.{!certificaat Let op: je bent al je baan kwijt bij de General Marine.}",A.b([A.cQ("Het is tijd dat ik deze kaasdroom laat gaan",new A.aaK(),null),A.cQ("Ik ga door, het moet mij lukken om kaas te verkopen",new A.aaL(),null)],t.p),null))
r($,"aCq","aob",()=>A.dQ("Climax 2","Eindelijk ben je van die stomme vergadering af, wanneer je een brief ontvangt van Hornstra waarin hij vertelt dat hij langskomt om te kijken hoe het gaat met het verkopen van die twintig ton. Maar het gaat helemaal niet, want je hebt nog niets kunnen verkopen. Je kantoor is nu wel al helemaal in orde, maar je hebt nog maar vijf dagen voordat Hornstra komt en als je dan nog steeds niets hebt verkocht, is het afgelopen met de {naam}. Is dit dan het definitieve einde van de {naam} of is er toch een kleine kans dat het lukt om alle kaas in vijf dagen te verkopen? Met agenten gaat het niet meer lukken, maar misschien lukt het jou nog om zelf de kaas te verkopen.{!certificaat Let op: je bent al je baan kwijt bij de General Marine.}",A.b([A.cQ("Niet geschoten is altijd mis; ik probeer het nog \xe9\xe9n laatste keer",new A.aaM(),null),A.cQ("De {naam} staat ten dode opgeschreven; ik geef op",new A.aaN(),null)],t.p),null))
r($,"aCr","aft",()=>A.dQ("Climax 3A","Je pakt een paar kazen die je nog had liggen en gaat op pad om ze te proberen te verkopen aan de eerste de beste winkel. Maar hoe moet je dat eigenlijk doen? Je ziet een advertentie van een of andere Boorman, die kooplieden helpt die moeite hebben met verkopen. Je besluit erheen te gaan en nadat jij naar zijn advies hebt geluisterd, ga je op zoek naar een winkel. Nadat je een tijd voor de winkel bent gaan staan om je moed te verzamelen, ga je naar binnen en vraag je of je met de eigenaar kunt spreken. Deze blijkt niet ge\xefnteresseerd te zijn in het kopen van kaas en hij vertelt ook dat hij zelf voor Hornstra heef gewerkt, maar dat het een tijdsverspilling is. Als je thuiskomt kom je erachter dat jouw zoon een kist heeft kunnen verkopen aan een vriend, maar dat is nog lang geen twintig ton. Wat kun je nu nog doen? Jouw agenten nog eens aanschrijven? Nee, je hebt nog maar \xe9\xe9n optie:",A.b([A.cQ("Het is tijd dat die kaasellende een einde neemt",new A.aaO(),null)],t.p),null))
r($,"aCs","aoc",()=>A.dQ("Climax 3B","Je gaat deur aan deur om te vragen of mensen jouw kaas willen kopen. Je had de grootste moeite om die zware bollen kwijt te raken, wat slechts gelukte omdat je zei dat er niet te betalen was. Je komt erachter dat je eigenlijk niet goed weet hoe je moet verkopen. Had je misschien toch agenten moeten inhuren? Alsof de situatie niet al erg genoeg is, krijg je de volgende dag een brief van Hornstra waarin hij vertelt dat hij langskomt om te kijken hoe het gaat met het verkopen van die twintig ton. Maar het gaat dus helemaal niet. Je kantoor is nu wel al helemaal in orde, maar gaat het lukken om alle kaas te verkopen in vijf dagen of is dit dan het definitieve einde van de {naam}. \u201cAlles of niets\u201d, je probeert het nog \xe9\xe9n laatste keer, maar dit keer pak je het anders aan. Je zoekt advies bij een of andere Boorman, die kooplieden helpt die moeite hebben met verkopen, en je gaat naar een kaaswinkel toe. Nadat je een tijd voor de winkel bent gaan staan om je moed te verzamelen, ga je naar binnen en vraag je of je met de eigenaar kunt spreken. Deze blijkt niet ge\xefnteresseerd te zijn in het kopen van kaas en hij vertelt ook dat hij zelf voor Hornstra heef gewerkt, maar dat het een tijdsverspilling is. Als je thuiskomt kom je erachter dat jouw zoon een kist heeft kunnen verkopen aan een vriend, maar dat is nog lang geen twintig ton. Je hebt alles geprobeerd om die kaas te verkopen, je kunt nog maar \xe9\xe9n ding doen.",$.aft().f,null))
r($,"aCU","afE",()=>A.dQ("Peripetie","Nadat je de kist met kazen hebt dichtgespijkerd, breng je het met een taxi terug naar de patentkelders. Je begint je nu af te vragen waarom je ooit hebt geprobeerd om handelaar te worden. Is het misschien omdat je geen nee wilde zeggen tegen van Schoonbeke? Maar wat nog erger is, is dat je nu ook niet meer terug kunt, omdat je al ontslag hebt genomen bij je oude baan. Had je maar naar je vrouw geluisterd. Zij was verstandig en had waarschijnlijk al meteen begrepen dat dit niets zou worden. Je hebt nu niets meer: geen aanzien, geen {naam} en geen baan. Hoe moet je nu voor je gezin zorgen? Wat zal jouw vrouw ervan vinden dat je niet naar haar advies hebt geluisterd. Terwijl je deze dingen overweegt, breekt de dag aan waarop Hornstra langskomt, maar wanneer hij aanbelt heb jij niet de moed om de deur open te doen. Hornstra gaat weer weg en jij blijft alleen achter. Wat moet je nu doen? Moet je naar je vrouw gaan? Maar wil ze jou nog wel zien? Of is het misschien toch beter om weg te gaan en nooit meer terug te komen.",A.b([A.cQ("Ik heb niets meer te verliezen, ik ga troost zoeken bij mijn vrouw",new A.abH(),null),A.cQ("Ik ben een mislukte vader en echtgenoot, ik ga weg",new A.abI(),null)],t.p),null))
r($,"aCS","afD",()=>A.oi("Normale Einde","Nadat je de kist met kazen hebt dichtgespijkerd, breng je het met een taxi terug naar de patentkelders. Je begint je nu af te vragen waarom je ooit hebt geprobeerd om handelaar te worden. Is het misschien omdat je geen nee wilde zeggen tegen Van Schoonbeke? Wat zouden jouw vrouw en jouw kinderen hiervan vinden? Wanneer de volgende dag Hornstra komt, heb jij niet de moed om de deur open te doen. Wanneer hij eindelijk weggaat, vervult een grote berusting jouw hele wezen. Jouw vrouw staat in de keuken zonder iets te doen en kijkt jullie tuintje in. Je gaat op haar toe en sluit haar in jouw armen. En als jouw eerste tranen op haar verweerd gezicht vallen, zie je dat ze jou tegenweent. De kaastoren is ingestort. Je gaat weer terug bij de General Marine en je neemt ook weer je nederige plaats bij de kletspartij van Van Schoonbeke. Je brengt een bezoek aan \u2018t graf van je moeder en je bent blij dat zij die kaasramp niet heeft bijgewoond. En zo eindigt de {naam} en dit kaasverhaal.","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben je de fout (hamartia) in gegaan om zijn aanbod aan te nemen in plaats van jouw nederig bestaan als klerk te accepteren. Gelukkig heb jij wel een verstandige vrouw, naar wie je hebt geluisterd. Als je accepteert dat jij niet weet hoe je kaas moet verkopen en daarom agenten aanstelt, krijg je toch nog een kans om door te gaan met het verkopen van kaas. Aan het einde kun je nog kiezen om niet meer op te geven, maar uiteindelijk maakt dat niet meer uit, omdat je voorbestemd bent om te falen. Dit is ook het oorspronkelijke einde van het boek: het is geen goed einde, maar ook niet het slechtste."))
r($,"aD_","aos",()=>A.oi("Slechte Einde","Je voelt dat jouw prestige van man en vader met de dag vermindert en daarom besluit je om weg te gaan van jouw familie. Waarom heb je dan ook je plicht verlaten om kaas te gaan verkopen? Jouw vrouw en jouw kinderen hadden al vanaf het begin door dat het onzin was. Je denkt daarom dat ze jou nooit meer willen zien. Je brengt een bezoek aan \u2018t graf van je moeder en je bent blij dat zij die kaasramp niet heeft bijgewoond. Daarna ga je de rest van je leven leiden als een bedelaar. Je vraagt je soms af of het toch niet beter is om terug te gaan naar je familie om berouw te tonen en te vragen of ze jou willen helpen. Maar terwijl je denkt aan je eigen ellende heb jij niet de moed om terug te gaan.","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben je de fout (hamartia) in gegaan om zijn aanbod aan te nemen in plaats van jouw nederig bestaan als klerk te accepteren. Deze hamartia is alleen maar erger geworden, doordat je niet naar je vrouw hebt geluisterd. Als je accepteert dat jij niet weet hoe je kaas moet verkopen en daarom agenten aanstelt, krijg je toch nog een kans om door te gaan met het verkopen van kaas. Aan het einde kun je nog kiezen om niet meer op te geven, maar uiteindelijk maakt dat niet meer uit, omdat je voorbestemd bent om te falen. Omdat je ook je oude baan kwijt bent, eindig het alleen maar slechter. Het lukt jou niet om jouw fouten te accepteren en naar je familie toe te gaan. Hierdoor is er geen opluchting en dus geen Catharsis aan het einde. Daarom is dit ook het slechtste einde."))
r($,"aCn","ao9",()=>A.oi("Catharsis","Jij blijf nog even staan en een grote berusting vervult Jouw hele wezen. 't Is alsof je in bed door een liefdevolle hand wordt toegedekt. Maar jij moet naar de keuken. Jouw vrouw staat daar zonder iets te doen en kijkt jullie tuintje in. Je gaat op haar toe en sluit haar in jouw armen. En als jouw eerste tranen op haar verweerd gezicht vallen, zie je dat zij jou tegenweent. Je hebt nog steeds spijt dat je niet naar haar hebt geluisterd, maar je bent gelukkig omdat je naar jouw vrouw bent gegaan en zij jou troost. Vol optimisme ga jij op zoek naar een nieuwe baan. Alleen dit keer een nederige baan die bij jou past. Je eindigt dit verhaal met de woorden: \u201cBeste, beste kinderen. Lieve, lieve vrouw.\u201d","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben je de fout (hamartia) in gegaan om zijn aanbod aan te nemen in plaats van jouw nederig bestaan als klerk te accepteren. Deze hamartia is alleen maar erger geworden, doordat je niet naar je vrouw hebt geluisterd. Als je accepteert dat jij niet weet hoe je kaas moet verkopen en daarom agenten aanstelt, krijg je toch nog een kans om door te gaan met het verkopen van kaas. Aan het einde kun je nog kiezen om niet meer op te geven, maar uiteindelijk maakt dat niet meer uit, omdat je voorbestemd bent om te falen. Doordat je een tweede fout (hamartia) begaat door niet naar je vrouw te luisteren, wordt de tragedie groter. Daardoor is de troost aan het einde groter en het zelfbesef ook. Dit is dus het einde met de meeste catharsis."))
r($,"aD0","aot",()=>A.oi("Speciale Einde 1","Opgelucht, omdat je verlost bent van je kaasellende, maar teleurgesteld en gefrustreerd omdat je hebt gefaald ga jij weer terug naar huis. Er zijn een hoop mensen boos op jou geworden, maar je bent ook niet meer van plan hen tegen te komen. Hornstra is teleurgesteld dat er niets van is gekomen en van jouw broer heb je gehoord dat Van Schoonbeke niet heel blij is. Gelukkig ben je ook niet meer van plan bij hem op bezoek te gaan. Je hebt nu je les geleerd en je gaat door met het trouw vervullen van jouw taak als klerk. Aan de ene kant ben je teleurgesteld dat je hebt gefaald, maar aan de andere kant heb jij nog steeds een baan en ben je blij dat je op tijd bent gestopt met het verkopen van kaas, want het zou veel ellendiger kunnen zijn geweest...","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben je de fout (hamartia) in gegaan om zijn aanbod aan te nemen in plaats van jouw nederig bestaan als klerk te accepteren. Gelukkig heb jij wel een verstandige vrouw, naar wie je hebt geluisterd. Doordat je hebt geaccepteerd dat jij niet weet hoe je kaas moet verkopen en daarom agenten hebt aangesteld, heb je langer kunnen proberen kaas te verkopen. En daardoor had je ook de kans om eerder te stoppen, voordat het nog ellendiger werd. In die zin is dit een beter einde dan die van het boek, maar het is ook slechter omdat veel mensen boos worden."))
r($,"aD1","aou",()=>A.oi("Speciale Einde 2","Opgelucht, omdat je verlost bent van je kaasellende, maar teleurgesteld en gefrustreerd omdat je hebt gefaald ga jij weer terug naar huis. Er zijn een hoop mensen boos op jou geworden, maar je bent ook niet meer van plan hen tegen te komen. Hornstra is teleurgesteld dat er niets van is gekomen en van jouw broer heb je gehoord dat Van Schoonbeke niet heel blij is. Het liefst zou je nu door willen gaan met jouw oude leven, maar omdat je niet naar je verstandige vrouw hebt geluisterd, ben je nu je baan kwijt. Jouw ellende is dus nog niet voorbij, maar je bent wel blij dat je op tijd bent gestopt met het verkopen van kaas, want het zou veel ellendiger kunnen zijn geweest...","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben je de fout (hamartia) in gegaan om zijn aanbod aan te nemen in plaats van jouw nederig bestaan als klerk te accepteren. Deze hamartia is alleen maar erger geworden, doordat je niet naar je vrouw hebt geluisterd. Doordat je hebt geaccepteerd dat jij niet weet hoe je kaas moet verkopen en daarom agenten hebt aangesteld, heb je langer kunnen proberen kaas te verkopen. En daardoor had je ook de kans om eerder te stoppen, voordat het nog ellendiger werd, maar aan de andere kant is jouw ellende daarmee niet gestopt, omdat je niet naar je vrouw hebt willen luisteren."))
r($,"aCD","aoh",()=>A.oi("Goede Einde","Natuurlijk is Van Schoonbeke niet blij, maar met jouw echte vrienden beleef jij meer plezier dan je ooit bij Van Schoonbeke hebt beleefd. Je leeft nog steeds zuinig, ondanks dat je heel hard werkt, maar je bent wel gelukkig. Je voelt je op je plaats nu je niet met die snobs van Van Schoonbeke omgaat. Je familie is er altijd voor je wanneer je troost nodig hebt. Ook al is er niets veranderd sinds het begin van het verhaal, ben je nu veel gelukkiger, omdat je jouw lot als simpele klerk hebt geaccepteerd en je leven hebt leren waarderen.","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Toch ben jij aan het lot ontsnapt, door nee te zeggen tegen Van Schoonbeke. Je bent nederig gebleven en je hebt jouw plaats leren kennen. Het lot probeerde jou nog \xe9\xe9n laatste keer de verkeerde kant op te sturen, maar jij hebt de verleiding weerstaan. Daarom heb jij het beste einde van dit verhaal, dat ook het enige goede einde is zonder tragedie."))
r($,"aD5","aow",()=>A.oi("Vernedering","Het leven gaat door zoals vroeger: je blijft naar de gesprekken van Van Schoonbeke gaan, in de hoop dat je uiteindelijk een betere baan zult vinden en mee zult kunnen praten met de rest van de groep. Maar je vindt alleen vernedering en je behoudt je baan. Je leven wordt steeds eenzamer: je voelt je niet op je gemak bij de vrienden van Van Schoonbeke, maar je durft ook niet om te gaan met jouw collega\u2019s, omdat jij je schaamt dat jij met zulke lage mensen omgaat. Je begint je ook steeds meer te schamen voor je familie, omdat het niet de rijke familie is, die jij zou willen.","Het lot wilde dat jij in aanraking kwam met Van Schoonbeke en zijn aanbod. Het maakte dus niet uit wat jij koos. Eerst lukt het jou om aan het noodlot te ontsnappen, door nee te zeggen tegen Van Schoonbeke. Helaas heeft uiteindelijk toch het lot gewonnen, omdat jij niet sterk genoeg was om nee te zeggen tegen Van Schoonbeke en zijn vrienden. Maar door geen nee te zeggen, moest je uiteindelijk nee zeggen tegen je echte vrienden en zelfs je eigen familie."))
r($,"aCy","afv",()=>{var q=null
return A.dQ("Expositie 1","Jouw moeder is overleden; een nare geschiedenis natuurlijk. Je zat een beetje ongemakkelijk bij haar sterfbed samen met je zussen en jouw broer, die dokter is. Een paar dagen later was de begrafenis, die zoals gebruikelijk verliep, als je wel kunt spreken van een normale begrafenis. Er waren veel mensen aanwezig, waaronder een klant en vriend van jouw broer, die Van Schoonbeke heette. Hij nodigt jou uit om een keer bij hem op bezoek te komen. ",A.b([A.cQ("\u201cDat zal ik doen\u201d",new A.aaX(),q),A.cQ("\u201cNee sorry, ik heb het heel druk\u201d",new A.aaY(),q),A.cQ("Ik zeg wel \u201cja\u201d, maar ik kom niet",new A.aaZ(),q)],t.p),q)})
r($,"aCz","afw",()=>A.dQ("Expositie 2A","Je was op bezoek bij van Schoonbeke. Geld heeft hij in overvloed en al zijn vrienden hebben \xf3\xf3k geld. Jij voelde je niet op je gemak, want jij bent niet rijk. Jouw broer is ook niet rijk, maar omdat hij een dokter is, heeft hij alsnog aanzien. Maar jij hebt als nederige klerk geen aanzien. Je hebt nauwelijks iets gezegd gedurende het hele gesprek, zodat niemand daarachter zou komen. Van Schoonbeke wil jou helpen meer aanzien te krijgen, want in zijn milieu heeft mijnheer Van Schoonbeke eigenlijk het recht niet er vrienden zonder geld of titels op na te houden. Daarom biedt hij jou de mogelijkheid aan om vertegenwoordiger van Belgi\xeb te worden van de Nederlandse kaasfirma Hornstra. Je bespreekt het met je vrouw. Ze vindt het goed, maar ze vindt wel dat je niet meteen je baan bij de General Marine and Shipbuilding Company moet opgeven.",A.b([A.cQ("Ik geef meteen mijn baan op en stuur een brief naar Hornstra",new A.ab_(),new A.ab0()),A.cQ("Ik doe wat mijn vrouw zegt en stuur gewoon de brief naar Hornstra",new A.ab1(),null),A.cQ("Ik vind mijn baan wel goed zo, ik schrijf geen brief aan Hornstra",new A.ab2(),null)],t.p),null))
r($,"aCA","aof",()=>A.dQ("Expositie 2B","\u201cDat is erg jammer. Fijne dag nog.\u201d Jouw broer komt de volgende dag op bezoek. Hij betreurt het dat het jou niet was gelukt om bij Van Schoonbeke op bezoek te komen en hij legt wat meer over Van Schoonbeke uit. \u201cGeld heeft hij in overvloed en al zijn vrienden hebben \xf3\xf3k geld\u201d, vertelt hij, \u201cHij en zijn vrienden hebben allemaal veel aanzien. Hij zou voor jou een mooie baan kunnen regelen. Je zou kaashandelaar kunnen worden voor de Nederlandse firma Hornstra.\u201d Je zegt dat je erover na zult denken. Je bespreekt het met je vrouw. Ze vindt het goed, maar ze vindt wel dat je niet meteen je baan bij de General Marine and Shipbuilding Company moet opgeven.",$.afw().f,null))
r($,"aCB","aog",()=>A.dQ("Expositie 2C","Je leven gaat door: je gaat naar je werk, bezoekt het graf van je moeder en wanneer je weer thuis bent groet je vrolijk je vrouw en je kinderen. Jouw broer komt op bezoek en hij vraagt waarom je niet was komen opdagen. \u201cHet was heel gezellig\u201d, zegt hij, \u201cen Van Schoonbeke rekende er eigenlijk op dat je zou komen\u201d Je geeft geen duidelijk antwoord en daarna vraagt jouw broer of je misschien morgen wel wilt komen naar Van Schoonbeke.",$.afv().f,null))
r($,"aCF","aoi",()=>A.dQ("Intrige 1A","Na het schrijven van de brief, krijg je een telegram die jou uitnodigt om de volgende dag naar Amsterdam te gaan. Je meldt je ziek bij je werk en je gaat naar Amsterdam. Hornstra stelt jou aan als algemeen vertegenwoordiger voor Belgi\xeb en het Groothertogdom Luxemburg en hij zal twintig ton volvette Edammer kaas sturen naar Antwerpen als proef. Je tekent een contract voor vijf procent van de verkoopprijs en een salaris van driehonderd gulden per maand, wat meer dan het dubbele is van wat je verdiende. De volgende keer dat je bij Van Schoonbeke op bezoek bent, deelt hij jouw goede nieuws mee aan de rest, wat natuurlijk ook goed is voor hem. Je voelt je nu veel meer op je gemak en je durft veel meer te praten. Voor het eerst zit je niet in een hoekje maar je krijgt een plaats aangeboden tussen de rest. Wanneer je thuiskomt laat je het contract aan je vrouw zien, maar zij merkt op dat er staat dat Hornstra op elk moment het contract kan be\xebindigen. Daarom stelt zij voor dat je aan jouw broer vraagt of hij een certificaat kan maken dat jij verlof moet krijgen voor een of andere ziekte, zodat je niet hoeft te stoppen met jouw baan bij de General Marine. Persoonlijk ben jij van mening dat het een halfslachtige oplossing is en dat men in dergelijke gevallen het een of het ander moet doen.",A.b([A.cQ("Ik volg het advies van mij vrouw op en vraag mijn broer om een certificaat te maken ",new A.abo(),null),A.cQ("Als ik dit wil doen moet ik er volledig voor gaan: ik neem ontslag bij de General Marine",new A.abp(),new A.abq())],t.p),null))
r($,"aCH","afx",()=>A.dQ("Intrige 2A","De volgende morgen ga je meteen aan de slag met het inrichten van jouw kantoor. Er moet veel geregeld worden: bureau, schrijfmachine, telefoon en nog veel meer. Je moet ook nog een naam bedenken voor je onderneming. Er komen veel idee\xebn bij je op, maar wat gaat het worden?",A.b([A.ahZ("Naam Kiezen",new A.abt())],t.p),null))
r($,"aCI","aok",()=>A.dQ("Intrige 2B","Na het schrijven van de brief, krijg je een telegram die jou uitnodigt om de volgende dag naar Amsterdam te gaan en dat doe jij. Hornstra stelt jou aan als algemeen vertegenwoordiger voor Belgi\xeb en het Groothertogdom Luxemburg en hij zal twintig ton volvette Edammer kaas sturen naar Antwerpen als proef. Je tekent een contract voor vijf procent van de verkoopprijs en een salaris van driehonderd gulden per maand, wat meer dan het dubbele is van wat je verdiende. De volgende keer dat je bij Van Schoonbeke op bezoek bent, deelt hij jouw goede nieuws mee aan de rest, wat natuurlijk ook goed is voor hem. Je voelt je nu veel meer op je gemak en je durft veel meer te praten. Voor het eerst zit je niet in een hoekje maar je krijgt een plaats aangeboden tussen de rest. Wanneer je thuiskomt laat je het contract aan je vrouw zien, maar zij merkt op dat er staat dat Hornstra op elk moment het contract kan be\xebindigen. Misschien had je toch beter jouw baan niet meteen moeten opgeven. De volgende morgen ga je meteen aan de slag met het inrichten van jouw kantoor. Er moet veel geregeld worden: bureau, schrijfmachine, telefoon en nog veel meer. Je moet ook nog een naam bedenken voor je onderneming. Er komen veel idee\xebn bij je op, maar wat gaat het worden?",A.b([A.ahZ("Naam Kiezen",new A.abu())],t.p),null))
r($,"aCJ","afy",()=>A.dQ("Intrige 3","Jouw kantoor begint al vorm te krijgen, je mist alleen nog maar een bureau. Bij de volgende kletspartij van Van Schoonbeke deel jij de nieuwe naam van je onderneming mee en je toont het brievenpapier van de {naam}. De volgende morgen zijn de kazen aangekomen en je krijgt te horen dat ze in patentkelders worden opgeslagen totdat ze worden verkocht. Je neemt \xe9\xe9n kist als proef mee naar huis en je laat de vrienden van Van Schoonbeke het proeven en je merkt nu duidelijk dat jouw aanzien is gestegen. Jouw broer komt bij jou langs om de kaas te proeven en hij zegt dat je nu echt aan de slag moet gaan met het verkopen, maar jij moet eerst nog alles op orde hebben. Je hebt eindelijk een bureau kunnen vinden en je kunt nu aan de slag. Je moet alleen nog \xe9\xe9n ding bedenken: moet jij die kazen zelf gaan verkopen of is het beter om agenten in te huren, zodat jij je bezig kunt houden met de administratieve zaken?",A.b([A.cQ("Ik ga wel zelf kaas verkopen",new A.abv(),null),A.cQ("Ik huur agenten in om alle kaas te verkopen",new A.abw(),null)],t.p),null))
r($,"aCG","aoj",()=>A.dQ("Intrige 1B","Hornstra is eigenlijk teleurgesteld dat jij het aanbod niet hebt aangenomen, omdat het vernederend is voor hem om met zo een laag iemand om te gaan. Maar je leven gaat door en jij gaat nu elke week op bezoek bij Van Schoonbeke, wat altijd een vernederende ervaring is. Van Schoonbeke heeft niet verteld dat jij een klerk bent en voor de gezelschap ben jij dus een niemand. Ze praten steeds over restaurants waar jij nooit bent geweest en over rijke families waar jij nooit van hebt gehoord. Zwijgen is dus het enige wat je kunt doen. Jouw baan bij de General Marine verloopt ook zoals altijd: je werkt hard, maar verdient niet veel en je kunt op elk moment vervangen worden door een andere klerk. Wanneer je een keer ziet hoe jouw vrouw met haar gewone zuinigheid de boter smeert en het brood snijdt, bedenk je dat zij de vrouw van een koopman had kunnen zijn, als jij het aanbod van Van Schoonbeke had aangenomen. De volgende dag nodigt Tuil, een vriend van jou op je werk, om samen met Erfurt en Bartherotte (twee andere collega\u2019s) wat te gaan drinken. Maar jij moet dan eigenlijk naar Van Schoonbeke, waar je geen zin in hebt. Misschien is het tijd om toe te geven dat jij een klerk bent en niet past bij de kring van Van Schoonbeke. Aan de andere kant, wat zullen zij ervan vinden dat jij met zulke lage mensen omgaat. Was het misschien toch beter geweest om het aanbod aan te nemen?",A.b([A.cQ("Het is tijd dat ik het hele gezelschap van Van Schoonbeke naar de duivel zend!",new A.abr(),null),A.cQ("Ik zeg tegen Tuil dat ik niet kan komen (en misschien lukt het mij om in prestige te groeien)",new A.abs(),null)],t.p),null))
